export const ItemList = ({product}) => {
  return (
    <div>
        {
            product.map((element) =>{
                return <div key={element.id}>
                    <img src={element.image} alt="" />
                    <h2>{element.nombre}</h2>
                    <h3>{element.description}</h3>
                    <h3>{element.price}</h3>
                </div>
            })
        }
    </div>
  )
}
